import React from "react";
import "./App.css";
import Postuler from "./components/postuler-aide";
import Accueil from "./components/accueil";
import { BrowserRouter as Router, Switch, Route, Link } from "react-router-dom";

function App() {
  return (
    <div className="App">
      <Router>
        <div>



          <Switch>
            <Route path="/">
            <Accueil />
            </Route>
            <Route path="/users">
            <Postuler />
            </Route>

          </Switch>
        </div>
      </Router>

      <h1>Dashboard aide</h1>
    </div>
  );
}

export default App;
